Property.Value:
BEGIN
    SET NOCOUNT ON;

    DECLARE
        @StartTime DATETIME2(7),
        @EndTime DATETIME2(7),
        @Counter BIGINT = 1,
        @Milliseconds INT = 0;

    SET @StartTime = SYSDATETIME();

    WHILE (@Counter <= @NumberOfBatches)
    BEGIN
        DELETE TOP (@BatchSize)
        [w]
        FROM [dbo].[Waveform] AS [w]
        WHERE [w].[StartTimeUTC] < @StartTimeUTC;

        RAISERROR(N'Counter: %I64d RowCount: %d', -- Message text
                  10,                             -- Severity
                  1,                              -- State
                  @Counter,
                  @@ROWCOUNT)WITH NOWAIT;

        SET @Counter = @Counter + 1;
    END;

    SET @EndTime = SYSDATETIME();

    SET @Milliseconds = DATEDIFF(MILLISECOND, @StartTime, @EndTime);

    RAISERROR(N'Batch Size: %d  Number of Batches: %d - %d milliseconds', -- Message text
              10,                                                         -- Severity
              1,                                                          -- State
              @BatchSize,
              @NumberOfBatches,
              @Milliseconds);

    --PRINT 'Batch Size: ' + CAST(@BatchSize AS VARCHAR(30)) + '  Number of Batches: '
    --      + CAST(@NumberOfBatches AS VARCHAR(30)) + ' - '
    --      + CAST(DATEDIFF(MILLISECOND, @StartTime, @EndTime) AS VARCHAR(30)) + ' milliseconds';
END;

