CREATE PROCEDURE [dbo].[uspGetPatientWaveform]
    @TopicSessionID BIGINT = NULL,
    @StartTime DATETIME2(7) = NULL,
    @EndTime DATETIME2(7) = NULL
AS

BEGIN
    SET NOCOUNT ON;

    DECLARE
        @StartTime DATETIME2(7),
        @EndTime DATETIME2(7),
        @Counter INT = 1,
        @Milliseconds INT = 0;

    SET @StartTime = SYSDATETIME();

    WHILE (@Counter <= @NumberOfBatches)
    BEGIN
        INSERT INTO [dbo].[Waveform] ([SampleCount],
                                      [TypeName],
                                      [TypeID],
                                      [Samples],
                                      [Compressed],
                                      [TopicSessionID],
                                      [StartTimeUTC],
                                      [EndTimeUTC])
        SELECT TOP (@BatchSize)
            10000,                               -- SampleCount - INT (2 bytes for each sample)
            'My Old Type Name',                  -- TypeName - VARCHAR(50)
            (RAND() * 1000) + 1,                 -- TypeID - SMALLINT
            [s].[Uncompressed],                  -- Samples - VARBINARY(MAX)
            0,                                   -- Compressed - BIT
            (RAND() * 10000) + 1,                -- TopicSessionID - INT
            SYSUTCDATETIME(),                    -- StartTimeUTC - DATETIME2(7)
            DATEADD(SECOND, 1, SYSUTCDATETIME()) -- EndTimeUTC - DATETIME2(7)
        FROM [dbo].[Sample] AS [s];

        SET @Counter = @Counter + 1;
    END;

    SET @EndTime = SYSDATETIME();

    --PRINT 'Batch Size: ' + CAST(@BatchSize AS VARCHAR(30)) + '  Number of Batches: '
    --      + CAST(@NumberOfBatches AS VARCHAR(30)) + ' - '
    --      + CAST(DATEDIFF(MILLISECOND, @StartTime, @EndTime) AS VARCHAR(30)) + ' milliseconds';

    SET @Milliseconds = DATEDIFF(MILLISECOND, @StartTime, @EndTime);

    RAISERROR(N'Batch Size: %d  Number of Batches: %d  Milliseconds: %d', -- Message text
              10,                                                         -- Severity
              1,                                                          -- State
              @BatchSize,
              @NumberOfBatches,
              @Milliseconds)WITH NOWAIT;

    INSERT INTO [dbo].[Performance] ([Name],
                                     [BatchSize],
                                     [NumberOfBatches],
                                     [ElapsedTimeMs],
                                     [TotalRowsInTable])
    SELECT
        [t].[name],
        @BatchSize,
        @NumberOfBatches,
        DATEDIFF(MILLISECOND, @StartTime, @EndTime) / 1000.0,
        SUM([p].[rows])
    FROM [sys].[tables] AS [t]
        INNER JOIN [sys].[partitions] AS [p]
            ON [t].[object_id] = [p].[object_id]
        INNER JOIN [sys].[indexes] AS [i]
            ON [p].[object_id] = [i].[object_id]
               AND [p].[index_id] = [i].[index_id]
    WHERE [t].[name] = N'Waveform'
          AND [i].[index_id] < 2
    GROUP BY [t].[object_id],
             [t].[name];
END;

